import { Form, Input, Select } from 'antd';
import Modal from 'antd/lib/modal/Modal';
import { filter, last } from 'lodash';
import React, { useContext, useState } from 'react';

const { Option } = Select;

const AddClientModal = (props) => {
    const {
        isUpdate,
        showModal,
        setShowModal,
        setData,
        data
    } = props;

    const [loading, setLoading] = useState(false);
    const [form] = Form.useForm();

    const handleCancel = () => {
        setShowModal(false);
        form.resetFields();
        setData();
    };

    const onUserSubmitFinish = async (values) => {
        // // eslint-disable-next-line radix
        // const projectID = parseInt(projectId);
        // const variables = isUpdate
        //     ? { ...values, id: projectData?.id, project_id: projectID }
        //     : { ...values, project_id: projectID };

        // try {
        //     await client.mutate({
        //         mutation: isUpdate ? UPDATE_SENDER : CREATE_SENDER,
        //         variables: variables
        //     });
        //     setSenderData();
        //     form.resetFields();
        //     setShowModal(false);
        //     props.reloadData();
        // } catch (error) {
        //     return error;
        // } finally {
        //     setLoading(false);
        // }
    };

    const handleAdd = () => {
        setShowModal(true);
        form.submit();
    };

    return (
        <Modal
            title={isUpdate ? 'Edit Client' : 'Add Client'}
            visible={showModal}
            confirmLoading={loading}
            onOk={handleAdd}
            className="dialog"
            okText={isUpdate ? 'Save' : 'Add'}
            onCancel={handleCancel}
        >
            <Form
                form={form}
                initialValues={data}
                layout="vertical"
                onFinish={onUserSubmitFinish}
            >
                <Form.Item rules={['required']} name="name" label="Name">
                    <Input allowClear placeholder="Enter Name"/>
                </Form.Item>
                <Form.Item rules={['required']} name="email" label="Email">
                    <Input allowClear type="email"  placeholder="Enter Email" />
                </Form.Item>
                <Form.Item rules={['required']} name="password" label="password">
                    <Input allowClear type="password"  placeholder="Enter Password"/>
                </Form.Item>
                <Form.Item name="phone" label="Phone">
                    <Input allowClear  placeholder="Enter Phone No" />
                </Form.Item>
                <Form.Item name="Role" label="Role">
                    <Input allowClear />
                </Form.Item>
                <Form.Item name="about" label="About">
                    <Input allowClear />
                </Form.Item>
                <Form.Item name="age" label="Age">
                    <Input allowClear />
                </Form.Item>
                <Form.Item name="education" label="Education">
                    <Input allowClear />
                </Form.Item>
            </Form>
        </Modal>
    );
};

export default AddClientModal;
